import React from "react";
import { motion } from "framer-motion";

const RenderPokemonAbilityBox = () => {

    const boxAnim = {
        before: {
          y: '100vh',
          opacity: 0,
        },
        onScreen: {
          y: '0',
          opacity: 1,
        },
    }

    return (
        <motion.div variants={boxAnim} initial='before' animate='onScreen' exit='before'>
            
        </motion.div>
    )
}

export default RenderPokemonAbilityBox;
